import React from "react";

import Header from "../Header/Header";
// import Home from "../Home/Home"
import Hero from "../Home/Hero/Hero";
// import Hero from "./Hero/Hero";
// import Intro from "./Intro/Intro";
import Footer from "./Footer/Footer";
import Home from "../Home/Home";

const App = () => {
    return (
        <div>
            <Header />
            <Hero />
            <Footer />
        </div>
    );
};

export default App;
